import styled from "styled-components";

export const PotraitContainer=styled.div`
    width: 100vw;
    min-height: 100vh;
    
    background:#150f0f;
    color: #fff;
`

export const PotraitWrapper=styled.div`
    position: static;
    display: grid;
    height: auto;
    width: 100%;
    min-height: 920px;
    
   
`
export const PotraitCard=styled.div`
    margin:0 2rem;
    line-height: 2;
    width: 300px;
`
export const PotraitImg=styled.img`
    height: 456px;
    width: 350px;
    
`

export const PotraitHeading=styled.h1`
    font-size: clamp(2rem,2.5vw,3rem);
    text-align:center;
    margin-bottom: 5rem;
`
